import React from 'react';
import { Link } from 'react-router-dom';
import db from "../../db.json"

function Carrito() {

    const carrito = db.Carrito



    return (
        <>
            {carrito.map((info, i) => (
                <Col md="4" mb="2" key={i}>
                    <Link to={`/catalogo/${info.id}`}>
                        <Item prenda={info} />
                    </Link>
                </Col>
            ))}
        </>
    );
}

export default Carrito;
